description:
Pregnancy app guides you through pregnancy day-by-day and week-by-week. Based on your due date, you will receive personalized information, the latest parenting news and health information. 
You will get tools to help you prepare and feel in control every step of the way – helping you achieve a happy, healthy pregnancy.

To get started, simply enter your baby's due date. All health content is based on information from experts, so you can feel confident and prepared for the changes to your baby and body. 

Explore helpful pregnancy tools like baby size and weight visualizer, contraction timer, pregnancy weight chart, hospital bag list and newborn shopping list. 

Feature highlights:
- Daily and weekly pregnancy info;
- Beautiful images;
- Personal diary;
- Notes;
- Pregnancy weight log and chart;
- Contraction timer;
- Hospital bag list;
- Newborn shopping list;
- Baby size and weight visualizer;
- Mother's abdomen photos;
- Pregnancy week by week info;
- Articles, tips and tools;
- And much more!

----------------------------

You must note that use of this app is for informational purposes only, does not provide medical advice or diagnosis, is not intended to replace or be a substitute for any medical advice concerning you or your children, and you should always contact your medical advisors if you require medical related advice.
In turn, you understand that data you provide via the app does not constitute protected health information, as defined under the us health insurance portability and accountability act (“HIPAA”) or under similar legislation in your local jurisdiction.

Thrive Pregnancy serves as a “pregnancy passport” allowing women to coordinate their care and access needed resources.
Thrive Pregnancy “passport” smartphone app includes:

- Information for women to think about and discuss with their care provider relating to their prenatal care choices;
- Information for women to think about their needs for their pregnancy;
- Information about the care women can expect during pregnancy;
- A place to keep notes and a record of appointments, tests and results;
- A list of resources in Vancouver.

For mothers-to-be, The App  provide some required knowledge in the entire breeding cycle knowledge, and help expectant mothers to enjoy procedure of the wonderful pregnancy.

During pregnancy, expectant mothers are happy, but in the meantime the mother not only need to regular work, but also do more work to meet the baby born smoothly, this App provide the reminder feature, expectant mothers can customize some messages and set up time and cycles.

The App will be a surprise for Expectant mother!

- When you need to supplement with folic acid;
- When you need to give the child a name;
- When do you need to avoid chemicals;
- What you need to do checks;
- You can customize the message, set the reminder time, reminder cycle;

Prepared many sweet features for you！

The device supports the data sharing with Apple's Health App. Authorized user can obtain data from your BBT, ovulation test, sexual behavior, menstruation, petechial hemorrhage, the quality of cervical mucus, sleep analysis, height and weight, so as to have a more comprehensive understanding of your health status.

What could smart Himama pregnancy preparation assistant do for you?
[Finding the ovulatory date to determine the best timing for pregnancy] Input your body temperature, then you will immediately know the status of your ovulation of that day.
[Earlier detection of pregnancy, superior to any LH kit] Automatically detecting whether you are pregnant 18 days after conception.
[Earlier diagnosis of gynaecopathia, earlier detection for earlier treatment] Reminding of corpus luteum problems or ovulation disorders.
[Sleep monitoring for eugenics] Monitoring on total length of sleep and length of deep sleep all night.

Core functions of smart Himama pregnancy preparation doctor:
1. Reporting ovulation everyday: telling you whether you are ovulating, the likelihood of pregnancy and your high/low temperature zone based on your BBT of the day;
2. Drawing up BBT curve automatically, to intelligently observe the status of pregnancy;
3. Cause analysis on the difficulties in getting pregnant: reminding of and analyzing on corpus luteum problems or ovulation disorders;
4. Sleep monitoring: monitoring the accumulated length of sleep, length of deep/light sleep; determining the quality of sleep, and monitoring the time of going to sleep and waking up;

Newborn Baby Care, Advice, lessons, Tips & Tricks.

This app contains the following lessons to newborn parents:

"1" = "Congratulations!";
"2" = "Caring Begins at Birth";
"3" = "Your Newborn\’s Hospital Check-up";
"4" = "Ten Fingers and Ten Toes";
"5" = "Special Care for Your Newborn";
"6" = "When Your Newborn Cries";
"7" = "Changing Your Newborn’s Diaper";
"8" = "Brest or bottle feeding";
"9" = "Feeding Your Newborn";
"10" = "Bathing Your Newborn";
"11" = "Dressing Your Newborn";
"12" = "Shhh!! We’re Sleeping";
"13" = "Keeping Your Baby Safe";
"14" = "Your Newborn’s Admirers";
"15" = "Taking Your Newborn Out";
"16" = "If Your Newborn Gets a Cold";
"17" = "If You Have Questions";
"18" = "Well-baby Check-ups";
"19" = "When to Call Your Pediatrician";

All the Moms, Dads and parents-to-be! Do not miss a single important moment of your baby growth starting from the baby bump! Capture the daily fun and all milestones in your baby’s life in the most creative way!

The first word, the first tooth and the first step - these are the moments to keep. Make the milestones of your pregnancy and your sweet baby growth memorable with a vast collection of сute and funny child themed artworks! Enrich your baby's everyday photos with adorable designs and captions together with Tiny Memories!

With Tiny Memories you can:
- mark your baby’s life achievements with the help of a huge collection of milestone and other baby themed artworks organized in categories (Dates, Progress, First Time Milestones, Pregnancy Milestones, Birthday, Bigger Kids and many more);
- create cute and charming images using beautiful handpicked fonts for funny captions about your child;
- design warm greeting cards to send to grandparents and other relatives;
- sign your most memorable photos;
- make funny memes;
- combine image and text and create exclusive wallpapers for your screen to have you sweetie always with you;
- compose any other image that needs some stylish text on it.

Use hashtag #tinymemories for Instagram posts to share your happiness with friends and community and your adorable photos might get featured on @Tiny Memories!

Keep the best moments of your family life with Tiny Memories! Get it now and go on a journey to the world of creativity together with your little treasure!

For complete access to all Tiny Memories features, you will need to allow access to the following:

*Photos - to import your pictures, enrich them with adorable designs and save your creations;
*Camera so that you can capture pictures and apply artworks to them right in the app;
*Notifications to keep you informed when new designs, captions and fonts are added to the app.

